$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_33de4786ef798eb21fb17e358f2907b9'] = 'tag \"ID\" =>  Indique l\'identifiant de l\'article. L\'identifiant de chaque article doit être unique dans votre compte et ne peut pas être réutilisé d\'un flux à l\'autre. ';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_535327a84262bb09c699b7d8443aef71'] = 'tag \"TITLE\" => Il s\'agit du nom de votre article, qui est obligatoire.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_105678f76b5b7f580cf7e42e342cfa8a'] = 'tag \"DESCRIPTION\" => indique la description du produitrnComme nous utilisons ce texte pour permettre à l\'utilisateur de trouver votre article, n\'indiquez que des informations pertinentes pour le produit, mais soyez exhaustif';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_0f89b407a76c4507108d902cb4cef43b'] = 'tag \"GOOGLE PRODUCT CATEGORY\" => L\'attribut \'catégorie de produits Google\' [google product category] indique la catégorie du produit proposé, sur la base de la classification des produits Google.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_0553038d1985c7647fe480d8f6408135'] = 'tag \"PRODUCT TYPE\" => Cet attribut indique la catégorie du produit proposé, d\'après votre propre classification. ';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_376652ea6cb436d7d31a89348baa5e78'] = 'tag \"LINK\" =>  URL pointant directement vers la page de votre produit sur votre site Web. L\'utilisateur est redirigé vers cette URL lorsqu\'il clique sur votre article dans Google Shopping';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_21751997886728fb8dee8f8d97d5e301'] = 'tag \"LINK\" =>  URL pointant directement vers la page de votre produit sur votre site Web. L\'utilisateur est redirigé vers cette URL lorsqu\'il clique sur votre article dans Google Shopping';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_1f94aa64616eadbdd5406b922c71f29d'] = 'tag \"CONDITION\" =>  condition ou état de l\'article. Seules trois valeurs sont possibles : neuf [new], occasion, [used] , reconditionné [refurbished]';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_c2d82f0c8fab59f96fcb4ef4c8f58431'] = 'tag \"AVAILABILITY\" =>  indique la disponibilité de l\'articlernL\'attribut de disponibilité peut être associé à quatre valeurs seulement : en stock [in stock], disponible sur commande [available for order], non disponible [out of stock], précommande [preorder]';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_0e27a71d34ae4a363529a379325ec82d'] = 'tag \"PRICE\" => prix de l\'article. Le prix de l\'article doit être le prix le plus visible sur la page de destination.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_43016d7329bf2ac3184f865f01d0d0dc'] = 'tag \"GTIN\" =>  code d\'article international GTIN (Global Trade Identification Number) de l\'article';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_95c185f2c72bfcda8bb443aae59a5fe1'] = 'tag \"BRAND\" =>  marque de l\'article. Obligatoire pour tous les articles, sauf pour les livres, les produits multimédias et les biens personnalisés, ou si vous définissez les attributs référence fabricant [mpn] et ean [gtin].';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_f2dc5d0a47e95dbf13670358baf33777'] = 'tag \"MPN\" =>  indique la référence fabricant de l\'article. Il s\'agit d\'un code permettant au fabricant d\'identifier de façon unique un produit. Plus précisément, la combinaison de la marque et de la référence fabricant identifie clairement un produit.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_7fdc89119c57b600a00faae7a3cb193d'] = 'tag \"ADULT\" => The adult status assigned to your product listings through the ‘adult’ attribute affects where product listings can show';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_4f8b1378ba0b094ea6017609b24b8b81'] = 'tag \"GENDER\" =>  indique le genre de l\'articlernTrois valeurs prédéfinies sont possibles : Homme, Femme, Unisexe';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_89a5d525c96784178a1797abf4f996a5'] = 'tag \"AGE GROUP\" => Pour cet attribut, seules les deux valeurs suivantes sont possibles : \"adults\" (adultes), \"kids\" (enfants)';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_828d5792f6e0420f89c85fe36b68ecbe'] = 'tag \"COLOR\" => Cet attribut définit la ou les couleurs dominantes d\'un article. ';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_b21faedada81d28249bacaa291bb1f64'] = 'tag \"SIZE\" =>  indique la taille de l\'article';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_7529cf9554ca24e52d66ae6acec38417'] = 'tag \"AGE GROUP\" => Pour cet attribut, seules les valeurs suivantes sont possibles : \"maternité\", \"gros et grand\", \"petite\",\"plus\",\"regular\"';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_0b1c668ed78505296decab867eb68939'] = 'tag \"SIZE SYSTEM\" => seules les valeurs dans la configuration du module sont acceptées';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_803d18ceedf37835dcac0f31abd8b3df'] = 'tag \"MATERIAL\" => Matière ou tissu constituant un produit.';
