$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_3c8a80bbd741dae60b6ad04a417d4303'] = 'tag \"ITEM GROUP ID\" => Les articles qui sont des variantes de couleur/matière/motif/taille d\'un même produit doivent avoir le même identifiant groupe. ';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_91400488d34b0e6315c4ea1236545131'] = 'tag \"SHIPPING WEIGHT\" => Il s\'agit du poids du produit permettant de calculer les frais de port. Si vous avez défini une règle de livraison globale basée sur le poids du colis, cet attribut sert à calculer automatiquement les frais de port de l\'article.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>module-tools_class_5e1299a0cca324dc27e1b078626a248b'] = 'tag \"SHIPPING\" => Cet attribut indique une estimation des frais de port du produit. Lorsque vous définissez cet attribut pour un article, il remplace les paramètres de livraison généraux définis dans Google Merchant Center. A utiliser si vous souhaitez indiquer les frais de port pour l\'article en question ou remplacer les frais de port par défaut définis dans les paramètres de Google Merchant Center.';
