$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_5e317d1aa73d288fdb4e729f971d675e'] = 'Entrez un court préfixe pour  votre boutique. Par exemple, si votre boutique s\'appelle \"Fleurs Martin\", entrez fm. Ceci est obligatoire si vous gérez des flux pour plusieurs boutiques différentes à partir de votre compte Google Merchant Center. Veuillez saisir des lettres minuscules uniquement';
