$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_d057f3b727af0fea800fecf8f541fc72'] = 'Ceci détermine le nombre de produits traités par cycle AJAX ou CRON. La valeur par défaut est 200. Augmentez cette valeur uniquement si vous avez un gros catalogue et rencontrez des problèmes de limites serveur. Sinon, laissez à 200. Elle ne devrait en tous cas pas être plus haute que 1000.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_4403a36d1b4bc0df0cfeb571b558bcc6'] = 'Nombre de produit par cycle';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_52fe395466e156c9088e067132b3d9ea'] = 'Choisissez la plus grande taille disponible (comme thickbox). Google requiert au moins 250x250 et recommande au moins 400x400 pixels.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_26821f5e00fb4180ee21097d0032273e'] = 'Taille de l\'image pour vos produits';
