$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_51d662b993ceef5ba46e464b9c578c2e'] = 'Sur la version 1.5, la catégorie Accueil peut avoir une ID égale à 1 ou à 2, s\'il s\'agit d\'une installation vierge ou bine d\'une upgrade à partir d\'une version antérieure. Nous avons besoin de cet ID et ne pouvons le déterminer automatiquement, ce pourquoi il vous faut le renseigner ici.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_895a8bc6f0edb3186eb3ae1b5fe62840'] = 'Sélectionner la catégorie HOME';
