$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_798670fe6e340770c971523d573d1386'] = 'Nom de la catégorie \"HOME\"';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_dac45f89f9ef118fb31c201ddad28934'] = 'Si vous soumettez plusieurs flux dans la même langue mais avec des monnaies différentes, comme par exemple les USA ($) et le Royaume-Uni (£), alors vous devez mettre ce réglage sur Oui (sinon, mettez sur Non), et, si oui, vous devez également overrider la classe Tools.php.. Ainsi, votre site pourra afficher les prix dans la même devise que dans le flux.  											';
