$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_60958b322a722363c4925e373efc4bfc'] = 'Attention : cette option va configurer le titre de votre article avec le nom de la catégorie courante. Google n\'accepte pas les titres qui dépassent 150 caractères.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_8ba4b6c0dcd32ef99ab0371a79133cbc'] = 'Attention : cette option va configurer le titre de votre article avec le nom de la marque. Google n\'accepte pas les titres qui dépassent 150 caractères.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>basics_05147e199cfbfc6e48d43e67ed65b194'] = 'Google refusera votre flux si vos titres de produits contiennent trop lettres MAJUSCULES. Cette fonction vous permet de régler le problème en ne capitalisant que le première lettre du titre. Si le nom de la marque est inclus dans votre produit et que le produit a son attribut Fabricant renseigné dans la fiche avec la même orthographe, la fonction essaiera de capitaliser le nom de la marque. Ex: \"Sac En Cuir LOUIS VUITTON\" deviendra \"Sac en cuir Louis Vuitton\".';
