$_MODULE['<{gmerchantcenterpro}jms_delphinus>body_5b7ea57b895f2b0372a760c5196303e2'] = 'Merci de consulter la rubrique AIDE (dernier onglet dans le menu top)';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>body_e4e31f50488985c6543b6d5879b000a1'] = 'Merci de lire attentivement les ressources à disposition dans l\'onglet AIDE / FAQ. Vous devez aussi comprendre que toutes les erreurs retournées par Google concernant des données manquantes (par exemple EAN, Images , Description), doivent être corrigées par vous même. Il faut donc faire attention à la qualité de vos données.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>body_b4cf7f62d6aa36ed9b26cd7a04efd396'] = 'Votre configuration est en cours de mise à jour';
