$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_9c44f05cef4c6a84bad1284791b9320a'] = 'Catégories produit Google';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_65a896ae3d621b7275b29f212e109d32'] = 'Chaque pays Google Shopping a sa propre taxonomie de catégories (certains pays partagent la même cependant). Donc, vous devez faire correspondre les catégories pour chaque pays ou groupe de pays. Par exemple, si vous voulez soumettre pour US et UK / GB, vous devez le faire pour chacun d\'eux et pouvez laisser les pays non désirés. Veuillez noter que tous les types de produits ne nécessitent pas de catégorie Google. Voir http://www.google.com/support/merchants/bin/answer.py?answer=160081 pour plus d\'informations.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_c9ad036fba9346fd21a16a3380e85c98'] = 'Utilisez l\'outil ci-dessous pour gérer vos catégories Google. L\'icône crayon  vous permet de faire correspondre vos catégories PrestaShop à celles de Google.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_01b3623eecce0e973e95003987ca225a'] = 'permet de mettre à jour la base de données de catégories Google du module depuis la liste officielle de Google. L\'icône \"recharger\"  vous ';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_791d8625f3723830dcd02940d76e2277'] = 'permet une mise à jour en temps réel des catégories Google dans votre base de données. En théorie vous n\'en avez pas besoin car Google ne met pas cette liste à jour souvent, mais si vous remarquez des différences entre les choix de catégories qui vous sont proposés et ce que vous pouvez trouver sur http://www.google.com/support/merchants/bin/answer.py?answer=160081, vous pouvez mettre votre base de données à jour. ';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_8839340a1536c71f728316742c8cb319'] = 'Vos catégories Google sont en cours de mise à jour';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_5fdba3796d30c8b2b6fda478f14de86c'] = 'Intégration avec Google analytics';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_846857ff79f642ec1601be33c86f5ca5'] = 'Cette section vous permet d\'ajouter des paramètres d\'URL supplémentaires dans vos liens de produits (utm_campaign, utm_source and utm_medium). Cela vous permet de mieux tracker vos campagnes Google Adwords de \"Product Listing Ads\" dans votre compte Google Analytics. Si un paramètre est vide, il ne sera pas ajouté dans l\'URL. Veuillez utiliser uniquement des chiffres et lettres, sans espaces. Vous pouvez utiliser les signes - ou _ en revanche. ';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_5a5d38f724b020227bc9c4caa61df61b'] = 'Note : si vous utilisez cette fonctionnalité, assurez-vous de bien vérifier que les paramètres utm_campaign, utm_source and utm_medium ne soient pas interdits dans votre fichier robots.txt.';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_c90340194771d4558dfae9ec22941b06'] = 'Valeur pour utm_campaign';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_ed8a6f100683f8f6822d4042de9c7ee2'] = 'Valeur pour utm_source';
$_MODULE['<{gmerchantcenterpro}jms_delphinus>google-settings_70bb325eec615ef0f8b01b10c1a4afc6'] = 'Valeur pour utm_medium';
